I have a list of names and I want to sort them in alphabetical order. I want to use case-sensative sorting. I have tried the following code but it is not working.
var names = ["John", "jane", "james", "jim"];
names.sort();
console.log(names);
I want the output to be ["jane", "james", "John", "jim"] but it is giving me ["jane", "james", "Jim", "John"] .
How can I achieve this?
